          Release notes generated using configuration in .github/release.yml at main
          -->\\r\\n\\r\\n## What's Changed\\r\\n### \U0001F680 New Features\\r\\n* feat:
          Added organization role support by @stevehipwell in https://github.com/integrations/terraform-provider-github/pull/2487\\r\\n*
          feat: Add file path protection to rulesets by @grahamhar in https://github.com/integrations/terraform-provider-github/pull/2415\\r\\n*
          feat: Support team organization role assignment by @felixlut in https://github.com/integrations/terraform-provider-github/pull/2322\\r\\n*
          feat: Add support for 'exempt' github_repository_ruleset bypass_mode by @joshhunt
          in https://github.com/integrations/terraform-provider-github/pull/2764\\r\\n*
          feat: Add `github_actions_organization_secret_repository` resource by @ylascombe
          in https://github.com/integrations/terraform-provider-github/pull/2760\\r\\n*
          feat: \U0001F3F3️ Custom properties resource & data by @alileza in https://github.com/integrations/terraform-provider-github/pull/2107\\r\\n*
          feat: Add support for `DeployKey` actor type in repository and organization
          rulesets by @tiulpin in https://github.com/integrations/terraform-provider-github/pull/2748\\r\\n\\r\\n###
          \U0001F41B Bugfixes\\r\\n* fix: Allow parallel_requests to be set on github.com
          by @SamuZad in https://github.com/integrations/terraform-provider-github/pull/2715\\r\\n*
          fix: Fixed issue labels adoption by @stevehipwell in https://github.com/integrations/terraform-provider-github/pull/2430\\r\\n*
          fix: Importing rulesets by @ihor-hrytskiv in https://github.com/integrations/terraform-provider-github/pull/2488\\r\\n*
          fix: Add missed parameter to the github_organization_ruleset by @yurii-kysil
          in https://github.com/integrations/terraform-provider-github/pull/2545\\r\\n*
